import React from "react"
import "./home.css";
import Social from "./Social";
import Data from "./Data";
import ScrollDown from "./ScrollDown";
import SemiCircle from "../../assets/semi circle.svg";
import Circle from "../../assets/circle.svg";
import Squiggly from "../../assets/squiggly.svg";
import triangle from "../../assets/triangle.svg";

function Home(){
    return (
        <section className="home section" id="home">
            <div className="home__container container_ grid_">
                <div className="home__content grid_">
                    <Social />

                    <div className="home__img"></div>

                    <Data />
                </div>

                <ScrollDown />
            </div>
            <img src={SemiCircle} class="shape shape--0" alt=""/>
            <img src={Circle} class="shape shape--1" alt=""/>
            <img src="./assets/squiggly.svg" class="shape shape--2" alt=""/>
            <img src={Circle} class="shape shape--3" alt=""/>
            <img src="./assets/triangle.svg" class="shape shape--4" alt=""/>
            <img src={Circle} class="shape shape--5" alt=""/>
            <img src="./assets/squiggly.svg" class="shape shape--6" alt=""/>
            <img src={Circle} class="shape shape--7" alt=""/>
            <img src={SemiCircle} class="shape shape--8" alt=""/>
        </section>
    )
}

export default Home;
